'use babel';
/** @jsx etch.dom */

import etch from 'etch'
import FlizzBadgeView from './flizz-badge-view';
import { CompositeDisposable } from 'atom';

$ = jQuery = require('./jquery-3.3.1.min.js');
require('./jquery-ui.min.js');

var badgeAdded = false;
var badgeEnabled = false;

export default {

  flizzBadgeView: null,
  modalPanel: null,
  subscriptions: null,

  activate(state) {
    this.flizzBadgeView = new FlizzBadgeView(state.flizzBadgeViewState);
    this.modalPanel = atom.workspace.addModalPanel({
      item: this.flizzBadgeView.getElement(),
      visible: false
    });

    // Events subscribed to in atom's system can be easily cleaned up with a CompositeDisposable
    this.subscriptions = new CompositeDisposable();

    // Register command that toggles this view
    this.subscriptions.add(atom.commands.add('atom-workspace', {
      'flizz-badge:toggle': () => this.toggle()
    }));
  },

  deactivate() {
    this.modalPanel.destroy();
    this.subscriptions.dispose();
    this.flizzBadgeView.destroy();
  },

  serialize() {
    return {
      flizzBadgeViewState: this.flizzBadgeView.serialize()
    };
  },

  toggle() {
		if (badgeAdded && badgeEnabled) {
			// Fade out badge
			$('.flizz-badge').fadeOut();
		} else if (badgeEnabled) {
			$('.flizz-badge').fadeIn();
			badgeAdded = false;
		} else {
			// Create & add badge
			const view = new BadgeComponent();

			$("body").append(view.element);

			setTimeout(1000, $('.flizz-badge').draggable());
		}

		badgeAdded = !badgeAdded;
		badgeEnabled = true;

  }

};

class BadgeComponent {
  constructor () {
    etch.initialize(this)
  }

  render () {
    return <div><img class="flizz-badge" src={badgeImg}></img></div>
  }

  update (props, children) {
    return etch.update(this);
  }
}

function addBadge() {
	if (badgeAdded && badgeEnabled) {
		// Fade out badge
		$('.flizz-badge').fadeOut();
	} else if (badgeEnabled) {
		$('.flizz-badge').fadeIn();
		badgeAdded = false;
	} else {
		// Create & add badge
		const view = new BadgeComponent();

		$("body").append(view.element);

		setTimeout(1000, $('.flizz-badge').draggable());
	}

	badgeAdded = !badgeAdded;
	badgeEnabled = true;
}

badgeImg = "data:image/png;base64,";
